vast amount of items to buy, just like the first game 2 armor sets, a whack of weapons and decorations for the Netherworld. The combat itself is fun a mix of rts, strategy, and hack n slash. Quaver and Gnarl are both pretty funny and have some good lines. As well as some of the npc's. Overall an amazing RPG and is in my top 5 favorite games, so with all that being said I really truly hope you enjoy watching this longplay as much as I had fun recording it :)\n\n\nPlayed on PC (Steam)\n\n\nGood Ole Overlord II\n\n\nGameplay recorded by Loopy\n\n\n\nTimestamps:\n\nIntro - "},{"text":"0:00"},{"text":"\nNordberg - "},{"text":"1:23"},{"text":"\nMelting the Ice - "},{"text":"18:30"},{"text":"\nBecoming the Overlord - "},{"text":"20:02"},{"text":"\nHunting Grounds - "},{"text":"23:35"},{"text":"\nYeti Fight - "},{"text":"38:42"},{"text":"\nSanctuary Cave - "},{"text":"42:48"},{"text":"\nThe Gnomes - "},{"text":"46:43"},{"text":"\nNordberg Outskirts - "},{"text":"48:00"},{"text":"\nThe Netherworld - "},{"text":"55:18"},{"text":"\nThe Foundations (Forge) - "},{"text":"57:48"},{"text":"\nThe Minion Burrows - "},{"text":"1:01:04"},{"text":"\nPrivate Quarters - "},{"text":"1:07:30"},{"text":"\nNordberg blockade - "},{"text":"1:14:14"},{"text":"\nNetherworld Shard - "},{"text":"1:16:34"},{"text":"\nRed Minions - "},{"text":"1:24:48"},{"text":"\nThe Netherworld - "},{"text":"1:45:11"},{"text":"\nConquering Nordberg - "},{"text":"1:51:05"},{"text":"\nWolves - "},{"text":"2:01:55"},{"text":"\nBreaching the Front Gate - "},{"text":"2:12:20"},{"text":"\nBorius - "},{"text":"2:24:05"},{"text":"\nMistress Kelda - "},{"text":"2:26:45"},{"text":"\nConquering Nordberg Town - "},{"text":"2:30:13"},{"text":"\nBack to the Netherworld - "},{"text":"2:53:02"},{"text":"\nNordhaven (Tar Pits) - "},{"text":"2:59:20"},{"text":"\nSetting sail on our first ship - "},{"text":"3:17:14"},{"text":"\nEverlight Reef - "},{"text":"3:21:33"},{"text":"\nDiscovering Everlight - "},{"text":"3:58:39"},{"text":"\
